import React from "react";
import Item from "./Item";

const ItemGrid = ({ items }) => {
  const itemsList = items.map((item) => <Item key={item.image} item={item} />);
  return (
    <>
      <ul className="item-grid"></ul>
    </>
  );
};

export default ItemGrid;
